Equations:
equations{ 'hl_des' } = define() {
	return ?${csp.mslf.sf.rec_model}
[
	${csp.mslf.sf.HL_T_coefs0} +
	${csp.mslf.sf.HL_T_coefs1} * ${csp.mslf.sf.avg_dt_des} +
	${csp.mslf.sf.HL_T_coefs2} * pow(${csp.mslf.sf.avg_dt_des},2) +
	${csp.mslf.sf.HL_T_coefs3} * pow(${csp.mslf.sf.avg_dt_des},3) +
	${csp.mslf.sf.HL_T_coefs4} * pow(${csp.mslf.sf.avg_dt_des},4)
	, 
	${csp.mslf.sf.HCE_FieldFrac1} * ${csp.mslf.sf.Design_loss1} +
	${csp.mslf.sf.HCE_FieldFrac2} * ${csp.mslf.sf.Design_loss2} +
	${csp.mslf.sf.HCE_FieldFrac3} * ${csp.mslf.sf.Design_loss3} +
	${csp.mslf.sf.HCE_FieldFrac4} * ${csp.mslf.sf.Design_loss4}
]	; };

equations{ 'DP_pressure_loss' } = define() {
	return ${nMod} * ${DP_nominal}; };

equations{ 'csp.mslf.sf.avg_dt_des' } = define() {
	return ( ${T_loop_in_des} + ${T_loop_out} ) / 2 - ${T_amb_sf_des}; };

equations{ 'loop_therm_eff' } = define() {
	return 1 - ${hl_des} * ${L_mod} * ${nMod} /
	(${a_loop} * ${I_bn_des} * ${loop_opt_eff}); };

equations{ 'opt_derate' } = define() {
	return ?${csp.mslf.sf.rec_model}
[
	1
, 	
	 ${csp.mslf.sf.HCE_FieldFrac1}*${csp.mslf.sf.Shadowing1}*${csp.mslf.sf.dirt_env1} +
	 ${csp.mslf.sf.HCE_FieldFrac2}*${csp.mslf.sf.Shadowing2}*${csp.mslf.sf.dirt_env2} +
	 ${csp.mslf.sf.HCE_FieldFrac3}*${csp.mslf.sf.Shadowing3}*${csp.mslf.sf.dirt_env3} +
	 ${csp.mslf.sf.HCE_FieldFrac4}*${csp.mslf.sf.Shadowing4}*${csp.mslf.sf.dirt_env4}
]; };

equations{ 'opt_normal' } = define() {
	return  ${TrackingError}
 * ${GeomEffects}
 * ${reflectivity}
 * ${Dirt_mirror}
 * ${Error}; };

equations{ 'opt_model' } = define() {
return ${csp.mslf.sf.opt_model} + 1; };

equations{ 'rec_model' } = define() {
return ${csp.mslf.sf.rec_model} + 1; };


