	//case 1: p1[i]=26; break; // Argon
	//case 2: p1[i]=27; break; // Hydrogen
	//default: p1[i]=1; break; // Air

	for (i=0;i<4;i++) {
		if(hce[i] == 1)
			hce[i] = 26;
		elseif(hce[i] == 2)
			hce[i] = 27;
		else
			hce[i] = 1;
	}		
	return hce;
};






